INSERT INTO `msevents` (`id_events`, `events_name`, `events_img`, `events_desc`, `events_date`, `events_index`, `visible`) VALUES
(1, 'Teguk Indonesia goes Public on The Indonesia Stock Exchange', 'Teguk_IDX_RINGTHEBELL-00.jpg', 'Teguk Beverages, a pioneer in innovation within the beverage industry, is proud to announce the upcoming launch of its initial public offering (IPO). This IPO will introduce revolutionary new products to a broader global audience.\r\nMaulana Hakim, CEO of TEGUK INDONESIA, expressed his excitement about the imminent IPO of TEGUK Beverages. Through this IPO, the company aims to strengthen its presence in the global market and deliver a range of revolutionary products to achieve extraordinary success. \"I am incredibly proud to lead TEGUK in becoming the first modern beverage company created by Indonesians to take the bold step of entering the Indonesian stock market. This move will inspire all our shareholders and stakeholders (customers) who have remained loyal to the TEGUK brand,\" added Maulana.\r\n\r\nTEGUK Beverages is a modern, HALAL-certified drink, and due to TEGUK Indonesia\'s recent evaluation showing the company has no debt, TEGUK shares will be part of the \"Sharia Stocks\" on the Indonesia Stock Exchange (IDX). A study by NAS Consulting & Research found that food and beverage companies listed on the IDX have shown continuously increasing stock values. This trend is likely to attract retail investor confidence during TEGUK\'s IPO, as food and beverage company stocks offer not only the potential for profit but also relatively affordable prices.\r\nThe funds raised from this IPO will support further development of our new products, including research, development, production, and marketing. The funds will also be used to fulfill TEGUK\'s commitment as part of \"local-pride Indonesia\" to go international, expand further, and increase the presence of outlets abroad, beyond the TEGUK New York outlet that opened in September 2022.\r\nWe invite interested investors to join us on this journey. The TEGUK Beverages IPO will provide a unique opportunity for investors to participate in the company\'s growth and benefit from its promising potential.\r\n\r\nFor more information about the TEGUK Beverages IPO, offered under the stock code \'TGUK,\' and how you can participate, visit our website at www.teguk.co.id or contact TEGUK Indonesia\'s Corporate & Media Relations division.\r\nDon\'t miss this opportunity to be part of TEGUK\'s revolutionary movement and seize your place in the ever-growing beverage market.', '2025-04-17 00:33:42', 1, 1);

