(1, 'Do your restaurants offer delivery?', 'We currently offer online ordering for in-store pickup and delivery options in most of our restaurants. Please refer to our website under the Order tab for our full list of delivery services that are available by location.', 1),
(2, 'Does any of your food contain alcohol?', 'We do not use alcohol to prepare any of our food.', 1),
(3, 'Are you a licenced restaurant?', 'All of our restaurants are licensed. We serve a selection of boutique beers, wines and ciders.\r\n', 1),
(4, 'Are your products pasteurised?', 'Our sauces and frozen custards are all pasteurised', 1),
(5, 'Do you offer dairy free menu options?', 'Our burger buns contain milk, so we would suggest you opt for our vegan bun and request we toast the bun without ghee to ensure we prepare you a dairy-free meal. You can also enjoy any burger wrapped in lettuce if youâ€™re looking for a lactose-free option. All our burgers also come with cheese, so please make our team aware of your dietary requirement so they can remove the cheese.\r\n\r\nUnfortunately the base of our thick shakes are made from our house-made custard ice cream which contains dairy, so we are unable to prepare a dairy-free version of it.', 1);

