(1, 'Hungry in Sydney', 'Exploring Chippendale\'s newest opening! From sweet Indonesian desserts at @urbandurian.au, to refreshing and unique drinks at @teguk.australia and sizzling grilled savoury dishes at @bintangbro.au , this eatery has it all!', 'img_testimoni.png', 1, 1, '2024-07-17 20:21:38', 5),
(2, 'Sydney Foodie', 'No gatekeeping allowed here I just found the newest durian dessert spot. This store actually has 3 different labels serving a mix of Indonesian dishes and dessert. From durian ice cream, pandan bingsoo to sambal chicken they have it all! Not to mention the portions are generous and looks aesthetic', 'img_testimoni.png', 2, 1, '2024-07-17 20:21:39', 5),
(3, 'Sammy B', 'The best dessert and nice food  Food: 5 | Service: 5 | Atmosphere: 5', 'img_testimoni.png', 3, 1, '2024-07-17 20:21:40', 5),
(4, 'Janet Wang', 'Loved the BintangBro fried chicken and Sambal Matah - authentic and tasty. Durian tiramisu and pandan desserts were refreshing but could use more durian flavor. Drinks were average, but overall concept is fantastic!', 'img_testimoni.png', 4, 1, '2024-07-17 20:21:41', 5);

